contract Dalmatian is ERC20, Ownable {
    using SafeMath for uint256;

    mapping(address => bool) private _isExcludedFromFee;
    address public marketingWallet;

    IDalmationV2Router02 public dalmationV2Router;
    address public immutable dalmationV2Pair;

    uint256 public swapTokensAtAmount = 1000 * (10**18);

    bool private swapping;
    uint256 public marketingFee;

    /**
     * @dev Constructor that gives msg.sender all of existing tokens.
     */
    constructor () ERC20("Dalmatian", "$DAL") {

        _mint(msg.sender,(1_000_000*(10**18)));

        marketingFee = 5;

        // marketingWallet = address(0x8f35Aa5fB354AaD8F5cBb98c62f25E76DC32D37D);

        marketingWallet = address(0x5B38Da6a701c568545dCfcB03FcB875f56beddC4);


        _isExcludedFromFee[owner()] = true;
        _isExcludedFromFee[address(this)] = true;
        _isExcludedFromFee[marketingWallet] = true;

        // IDalmationV2Router02 _dalmationV2Router = IDalmationV2Router02(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D); 
        IDalmationV2Router02 _dalmationV2Router = IDalmationV2Router02(0xf8e81D47203A594245E36C48e151709F0C19fBe8); 
        

        address _dalmationV2Pair = IDalmationV2Factory(_dalmationV2Router.factory())
            .createPair(address(this), _dalmationV2Router.WETH());

        dalmationV2Router = _dalmationV2Router;
        dalmationV2Pair = _dalmationV2Pair;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        if(amount == 0) {
            super._transfer(from, to, 0);
            return;
        }
 
        if (from != owner() && to != owner()) {

            uint256 contractTokenBalance = balanceOf(address(this));
        
            bool canSwap = contractTokenBalance >= swapTokensAtAmount;
 
            if (canSwap && !swapping && from != dalmationV2Pair && !_isExcludedFromFee[from] && !_isExcludedFromFee[to]) {
                swapping = true;
                swapTokensForMarketing(contractTokenBalance);
                swapping = false;
            }
        }
        bool takeFee = true;
 
        //Transfer Tokens
        if (_isExcludedFromFee[from] || _isExcludedFromFee[to]) {
            takeFee = false;
        }
        
        if(takeFee) {
        	uint256 fees = amount.mul(marketingFee).div(100);

        	amount = amount.sub(fees);
            super._transfer(from, address(this), fees);
        }

        super._transfer(from, to, amount);
    }

    function swapTokensForMarketing(uint256 tokenAmount) private {
        // generate the  pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = dalmationV2Router.WETH();

        _approve(address(this), address(dalmationV2Router), tokenAmount);

        // make the swap
        dalmationV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            marketingWallet,
            block.timestamp + 5 minutes
        );
    }

    function excludeMultipleAccountsFromFees(address[] calldata accounts, bool excluded) public onlyOwner {
        for(uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFee[accounts[i]] = excluded;
        }
    }

    function updateSwapTokensAtAmount(uint256 value) public onlyOwner{
  	    swapTokensAtAmount = value;
  	}
    
    function updateMarketingFee (uint256 _newFee) public onlyOwner {
        require (_newFee <=100,"should be less or equal 100 ");
        marketingFee=_newFee;
    }
}

